eval("module.exports = \"<template>\\r\\n  <div class=\\\"modal fade\\\" id=\\\"infographicModal\\\" tabindex=\\\"-1\\\" role=\\\"dialog\\\" aria-hidden=\\\"true\\\">\\r\\n    <div class=\\\"modal-dialog modal-xl modal-dialog-scrollable modal-dialog-centered\\\" role=\\\"document\\\">\\r\\n      <div class=\\\"modal-content\\\">\\r\\n        <div class=\\\"modal-body\\\">\\r\\n          <img src.bind=\\\"getImageSrc('infographic.jpg')\\\" alt=\\\"Infográfico\\\" style='width:100%'>\\r\\n        </div>\\r\\n      </div>\\r\\n    </div>\\r\\n  </div>\\r\\n  <div class=\\\"modal fade\\\" id=\\\"generalInfoModal\\\" tabindex=\\\"-1\\\" role=\\\"dialog\\\" aria-hidden=\\\"true\\\">\\r\\n    <div class=\\\"modal-dialog modal-xl modal-dialog-scrollable modal-dialog-centered\\\" role=\\\"document\\\">\\r\\n      <div class=\\\"modal-content\\\">\\r\\n        <div class=\\\"modal-body\\\">\\r\\n          <div>\\r\\n            <h4>Estilo Ativo</h4>\\r\\n            <p>Totalmente envolvidos e sem preconceitos em novas experiências, têm a mente aberta, realizam novas tarefas com entusiasmo. Crescem enfrentando os desafios de novas experiências e ficam entediados com prazos longos. Se envolvem nos assuntos dos outros e centralizam todas as atividades ao seu redor.</p>\\r\\n            <p>Características: Animador, Improvisador, Descobridor, Arrojado, Espontâneo, Flexível</p>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Estilo Reflexivo</h4>\\r\\n            <p>Pessoas que gostam de considerar experiências e observá-las de diferentes perspectivas; analisam os dados cuidadosamente e pensam antes de agir. Consideram todas as alternativas possíveis antes de fazer um movimento; observam o desempenho dos outros e não intervêm até que tenham assumido a situação. Criam um ar levemente distante e condescendente ao redor deles.</p>\\r\\n            <p>Características: Ponderado, Consciente, Receptivo, Analítico, Compreensivo</p>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Estilo Teórico</h4>\\r\\n            <p>Adaptam e integram observações em teorias lógicas e complexas; focam em etapas lógicas. Gostam de analisar e sintetizar. Tendem a ser perfeccionistas;</p>\\r\\n            <p>Integram os fatos em teorias coerentes e são profundos em seu sistema de pensamento ao estabelecer princípios, teorias e modelos. Buscam racionalidade e objetividade, fugindo do subjetivo e do ambíguo.</p>\\r\\n            <p>Características: Metódico, Lógico, Objetivo, Crítico, Estruturado</p>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Estilo Pragmático</h4>\\r\\n            <p>Descobrem o aspecto positivo de novas ideias e aproveitam a primeira oportunidade para experimentá-las. Agem com rapidez e segurança com as ideias e projetos que os atraem. São impacientes quando há pessoas que teorizam. Concisos quando há uma decisão a ser tomada ou um problema a ser resolvido. Acreditam que sempre podem fazer melhor.</p>\\r\\n            <p>Características: Experimentador, Prático, Direto, Eficaz, Realista</p>\\r\\n          </div>\\r\\n        </div>\\r\\n      </div>\\r\\n    </div>\\r\\n  </div>\\r\\n  <h4>Resultado do estudo de Estilos de Aprendizagem</h4>\\r\\n  <div class=\\\"justified-text\\\">\\r\\n    <p>Estes resultados identificam as suas preferências, indicando como você percebe, interage e responde ao ambiente de aprendizagem.</p>\\r\\n  </div>\\r\\n  <div class=\\\"card\\\">\\r\\n    <div class=\\\"card-header\\\" id=\\\"headingOne\\\" style=\\\"padding: 0;\\\">\\r\\n      <h2 class=\\\"mb-0\\\">\\r\\n        <button class=\\\"btn btn-link\\\" type=\\\"button\\\" data-toggle=\\\"collapse\\\" data-target=\\\"#collapseOne\\\" aria-expanded=\\\"true\\\" aria-controls=\\\"collapseOne\\\">\\r\\n          Recomendações e material de apoio\\r\\n        </button>\\r\\n      </h2>\\r\\n    </div>\\r\\n    <div id=\\\"collapseOne\\\" class=\\\"collapse\\\" aria-labelledby=\\\"headingOne\\\">\\r\\n      <div class=\\\"card-body justified-text pre-scrollable pb-0\\\">\\r\\n        <p>Os modelos de estilos de aprendizagem identificam de que forma as informações são percebidas e processadas, ou seja, as preferências pedagógicas de cada estudante. Quando as metodologias adotadas em sala de aula não estão em concordância com essas preferências, podem ocorrer dificuldades ou falhas na aprendizagem. Seus resultados seguem abaixo.</p>\\r\\n        <p>Alonso e Gallego (2002) constataram no campo educacional há predominância de quatro estilos de aprendizagem nos estudantes: ativo, reflexivo, teórico e pragmático, e elaboraram uma relação de características que determinam o campo de habilidade de cada um desses estilos.</p>\\r\\n        <p>Seu principal estilo de aprendizado: <b>${mainStudyOptionsAsString}</b></p>\\r\\n        <p>Para saber mais sobre seu estilo de aprendizagem você pode escolher um ou mais dos seguintes recursos disponíveis:</p>\\r\\n        <ul>\\r\\n          <li>Infográfico - Como eu aprendo?\\r\\n            <a href=\\\"\\\" data-toggle=\\\"modal\\\" data-target=\\\"#infographicModal\\\">\\r\\n              <span class=\\\"oi oi-document\\\" title=\\\"Documento\\\" aria-hidden=\\\"true\\\"></span>\\r\\n            </a>\\r\\n          </li>\\r\\n          <li>Características gerais dos estilos de aprendizagem\\r\\n            <a href=\\\"\\\" data-toggle=\\\"modal\\\" data-target=\\\"#generalInfoModal\\\">\\r\\n              <span class=\\\"oi oi-document\\\" title=\\\"Documento\\\" aria-hidden=\\\"true\\\"></span>\\r\\n            </a>\\r\\n          </li>\\r\\n        </ul>\\r\\n        <compose view=\\\"./students-extra-resources.html\\\" model.bind=\\\"result\\\"></compose>\\r\\n      </div>\\r\\n    </div>\\r\\n  </div>\\r\\n</template>\\r\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///viewmodels/student/result/EA.html\n");

